INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("あたしだって\nやるときはやるよ！", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 0, 1, "2020/04/30 12:00:00", 0.0, 1, 24001);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("ふぅ…\nこれであたしの仕事は\n終わりだね", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 1, 1, "2020/04/30 12:00:00", 0.0, 1, 24002);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("終わった終わった\n一人でもなんとか\nなるもんだね", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 2, 1, "2020/04/30 12:00:00", 0.0, 1, 24003);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("やったね！\nこれでようやく\nサボれるよ…", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 3, 2, "2020/04/30 12:00:00", 0.0, 2, 24004);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 4, 1, "2020/04/30 12:00:00", 0.0, 1, 24005);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("あたしを敵に回した\n恐ろしさ\n思い知ったか！", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 5, 2, "2020/04/30 12:00:00", 0.0, 2, 24006);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("あたしも意外と\nやるもんでしょ？", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 6, 2, "2020/04/30 12:00:00", 0.0, 2, 24007);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("疲れた…\nねずみの逃げ足\n速すぎるよ…", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 7, 4, "2020/04/30 12:00:00", 0.0, 4, 24008);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("このままじゃ\nまっひ～に\n叱られちゃうよ", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 8, 4, "2020/04/30 12:00:00", 0.0, 4, 24009);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("まじめに\nやったんだけどな…\n悔しいな～", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 9, 4, "2020/04/30 12:00:00", 0.0, 4, 24010);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("やられた…\nねずみって意外と\nてごわいね", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 10, 4, "2020/04/30 12:00:00", 0.0, 4, 24011);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("おのれ～\nあたしのチーズを\n盗みやがって～！", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 11, 4, "2020/04/30 12:00:00", 0.0, 4, 24012);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES ("疲れた…\nけど、次こそは\n守り抜くよ…", 102601, 0.0, 10040, "2030/12/17 14:59:59", "リン", 0.0, 24, 12, 1, "2020/04/30 12:00:00", 1.81, 4, 24013);
